	qcd_->Add(QCDshape);
	qcd_->Scale(qcdOStoSS);
	w_->Scale(sf);

	data_->SetMaximum(DATA_MAX*data_->GetMaximum());
	data_->SetMinimum(DATA_MIN);

	/* get a sum of bks */

	comb_->Add(vv_);
	comb_->Add(tt_);
	comb_->Add(w_);
	comb_->Add(ztt_);
    comb_->Add(zj_);
    comb_->Add(zl_);
    comb_->Add(zhtautau_);
    comb_->Add(tthjettt_);
    comb_->Add(glugluhtautau_);
    comb_->Add(vbfhtautau_);
    comb_->Add(whtautau_);
	comb_->Add(qcd_);
    
	/* small fix for when blinded data is empty */

	if(data_->GetSumOfWeights()==0)
	{
		data_->Add(comb_);
	}

	// scale things to the projected lumi
	vv_->Scale(lumi_sf);
	tt_->Scale(lumi_sf);
	ztt_->Scale(lumi_sf);
    zl_->Scale(lumi_sf);
