    tthjettt_->IntegralAndError(-1, tthjettt_->GetNbinsX()+1,tthjetttE);

    /* format the errors */

    if(wI>0.0){ wE = 1 + wE/wI; } else {wI = 0.0; wE = 1.0;}
    if(vvI>0.0){ vvE = 1 + vvE/vvI; } else {vvI = 0.0; vvE = 1.0;}
